function Overlapper(){var e=$(".ol-able");var t=0;this.init=function(n){var r=this;if(n){t=n.zStart||0}for(var i=0;i<e.length;i++){var s=$(e[i]);var o=t+i;s.css("z-index",o);s.on("click",function(){r.moveToFront($(this))});s.on("dragstart",function(){r.moveToFront($(this))})}};this.moveToFront=function(n){var r=n.css("z-index");n.css("z-index",t+e.length);for(var i=0;i<e.length;i++){var s=$(e[i]);if(+s.css("z-index")!=r&&+s.css("z-index")>+r){s.css("z-index",+s.css("z-index")-1)}}};this.moveToBack=function(n){var r=n.css("z-index");for(var i=0;i<e.length;i++){var s=$(e[i]);if(+s.css("z-index")!=r&&+s.css("z-index")<+r){s.css("z-index",+s.css("z-index")+1)}}n.css("z-index",t)}}